Reference Document: Inner Documentation \ devicetree \ linkings \ interrupt - controls \ interrupts. txt must have an attribute in the device tree in the interrupt controller node: interrupt-controller, indicating it is "a breaker" .
There must also be an attribute: #interrupt-cells, which indicates how many cells are required to refer to this interrupt controller.
# Interrupt-cells are generally the following values:
#interrupt-cells=<1>
When other nodes are to use this interrupt controller, only one cell is required to indicate the use of "which break".
#interrupt-cells =<2>
When other nodes are to use this interrupt controller, you need a cell to show which interrupt is used.
Another cell is needed to describe the interruption, usually indicating the trigger type:
The second cell bites [3:0] are used to represent the interrupt trigger type (trigger type and level flags):
1 = Low-to-high Edge triangled up along the trigger
2 = High-to-low Edge triangled, falling along the trigger
4 = Active high level-sensitive, high-level trigger
8 = Active low level-sensitive, low-level trigger
Take the example:
Vic: Intc@10140000 {
Conformity = "arm, versatile-vic";
Interrupt-controller;
# Interrupt-cells = <1>;
Reg = <0x10140000 0 x 1000>;
};
If the interrupt controller has a horizontal connection, the lower interrupt controller also needs to indicate who its "interrupt-parent" is (using which interrupt controller), using any "interrupt-parant" .
2. Use of interrupting in the equipment tree
An external, its interrupt signal is received from which "stop-up" of which "stopper" , what is the trigger mode?
These three problems are reflected when using a break in the equipment tree.
1 interrupt-parent="&XXX"
Which interrupt is the interrupt you want to use?
2. Interrupts
Which one do you want to break?
In Interrupts, several cells are to be determined by the interrupt-parent corresponding interrupt controller. There is a "#interrupt-cells" property in the interrupt controller that indicates that it is to be described as a break with several cells.
For example:
i2c@7000c000 {
gpioext: gpio-adnp@41 {
Conformity = "ad, gpio-adnp"; // Guaranteed drivers match
Interrupt-parent = < & gpio>; / / Explanation that the break it uses belongs to the interrupt controller
Interrupts = <160 1>; / / Shows that the 160 break in the interrupt controller is used, and the trigger type is up along the trigger.
gpio-controller; / / Show it is a interrupt controller
#gpio-cells = <1>; / / If you want to use it to break, you need to use a cell to describe the break that you use.
Interrupt-controller;
# Interrupt-cells = <2>;
};
};
3 New writing: interrupts-extensed
A "interrupts-extend" property can be specified either "interrupt-parent" or "interrupts", such as:
Interrupts-extended = <&intc1 5 1>, <&intc2 1 0>; / / Means that the interrupt is a part of the controller, and also describes the break that is used.
